import React, { useEffect, useState } from "react";
import axios from "axios";

const baseURL =
  "https://strangers-things.herokuapp.com/api/2206-ftb-et-web-ft-b";

const Post = () => {
  const [post, setPosts] = useState([]);

  useEffect(() => {

    const fetchPosts = async () => {
      try {
        const {data: posts} = await axios.get(`${baseURL}/posts`);
        setPosts(posts)

      } catch (err) {
        console.error(err);
      }
    };
    fetchPosts();
    console.log(post)
  }, []);

    post.map((eachPost, idx)=>{
      return(
        <div key={idx} class='post-title'>
          <p>{eachPost.title}</p>
          <p>{eachPost.description}</p>
          <p>{eachPost.price}</p>
        </div>

      )
    })

};

export default Post;
